let cartaMaquina
let cartaJogador

const packs = [
    cartaMbappe, cartaNeymar, cartaMessi, cartaCr7, cartaLewa, cartaAguero, cartaBenzama, cartaKane, cartaImmobile, cartaAubameyang, cartaSuarez, cartaGriezmann, cartaFirmino, cartaVardy, cartaLukaku, cartaDepay, cartaWerner, cartaMertens, cartaIcardi, cartaHaaland
]

let pontosJogador = 0
let pontosMaquina = 0

atualizaPlacar()
atualizaQuantidadeDeCartas()

function atualizaQuantidadeDeCartas() {
    let divQuantidadeDeCartas = document.getElementById('quantidade-cartas')
    let html = "Quantidade de cartas no jogo: " + packs.length

    divQuantidadeDeCartas.innerHTML = html
}

function atualizaPlacar() {
    let divPlacar = document.getElementById('placar')
    let html = "Jogador " + pontosJogador + "/" + pontosMaquina + " Máquina"

    divPlacar.innerHTML = html
}

function sortearCarta() {
    let numeroCartaMaquina = parseInt(Math.random() * packs.length)
    cartaMaquina = packs[numeroCartaMaquina]
    packs.splice(numeroCartaMaquina, 1)

    let numeroCartaJogador = parseInt(Math.random() * packs.length)
    cartaJogador = packs[numeroCartaJogador]
    packs.splice(numeroCartaJogador, 1)

    document.getElementById('btnSortear').disabled = true
    document.getElementById('btnJogar').disabled = false

    exibeCartaJogador()
}

function exibeCartaJogador() {
    let divCartaJogador = document.getElementById("carta-jogador")
    let moldura = '<img src="https://www.alura.com.br/assets/img/imersoes/dev-2021/card-super-trunfo-transparent.png" style=" width: inherit; height: inherit; position: absolute;">';

    divCartaJogador.style.backgroundImage = `url(${cartaJogador.imagem})`
    let nome = `<p class="carta-subtitle"> ${cartaJogador.nome} </p>`

    let opcoesTexto = ""

    for (let atributo in cartaJogador.atributos) {
        opcoesTexto += "<input type='radio' name='atributo' value='" + atributo + "'>" + atributo + " " + cartaJogador.atributos[atributo] + "<br>"
    }

    let html = "<div id='opcoes' class='carta-status'>"

    divCartaJogador.innerHTML = moldura+nome+html+opcoesTexto+'</div>'
}

function obtemAtributoSelecionado() {
    let radioAtributo = document.getElementsByName('atributo')
    for (let i = 0; i < radioAtributo.length; i++) {
        if (radioAtributo[i].checked) {
            return radioAtributo[i].value
        }
    }
}

function jogar() {
    let divResultado = document.getElementById("resultado")
    let atributoSelecionado = obtemAtributoSelecionado()

    while(atributoSelecionado.checked == ''){
        document.getElementById('btnJogar').disabled = true
    }

    if (cartaJogador.atributos[atributoSelecionado] > cartaMaquina.atributos[atributoSelecionado]) {
        htmlResultado = '<p class="resultado-final">Venceu</p>'
        pontosJogador++
    }
    else if (cartaJogador.atributos[atributoSelecionado] < cartaMaquina.atributos[atributoSelecionado]) {
        htmlResultado = '<p class="resultado-final">Perdeu</p>'
        pontosMaquina ++
    }
    else {
        htmlResultado = '<p class="resultado-final">Empatou</p>'
    }

    if(packs.length == 0){
        alert('Fim de Jogo')
        if(pontosJogador > pontosMaquina){
            htmlResultado = '<p class="resultado-final">Venceu</p>'
        }
        else if(pontosMaquina > pontosJogador){
            htmlResultado = '<p class="resultado-final">Perdeu</p>'
        }
        else{
            htmlResultado = '<p class="resultado-final">Empate</p>'
        }
    }
    else {
        document.getElementById('btnProximaRodada').disabled = false
    }

    divResultado.innerHTML = htmlResultado
    document.getElementById('btnJogar').disabled = true

    atualizaPlacar()
    exibeCartaMaquina()
    atualizaQuantidadeDeCartas()
}

function exibeCartaMaquina() {
    let divCartaMaquina = document.getElementById("carta-maquina")
    let moldura = '<img src="https://www.alura.com.br/assets/img/imersoes/dev-2021/card-super-trunfo-transparent.png" style=" width: inherit; height: inherit; position: absolute;">';

    divCartaMaquina.style.backgroundImage = `url(${cartaMaquina.imagem})`
    let nome = `<p class="carta-subtitle">${cartaMaquina.nome}</p>`

    let opcoesTexto = ""

    for (let atributo in cartaMaquina.atributos) {
        opcoesTexto += "<p type='text' name='atributo' value='" + atributo + "'>" + atributo + " " + cartaMaquina.atributos[atributo] + "</p>"
    }

    let html = "<div id='opcoes' class='carta-status'>"

    divCartaMaquina.innerHTML = moldura+nome+html+opcoesTexto+'</div>'
}

function proximaRodada() {
    let divCartas = document.getElementById('cartas')

    divCartas.innerHTML = `<div id="carta-jogador" class="carta"></div> <div id="carta-maquina" class="carta"></div>`
    document.getElementById('btnSortear').disabled = false
    document.getElementById('btnJogar').disabled = true
    document.getElementById('btnProximaRodada').disabled = true

    let divResultado = document.getElementById('resultado')
    divResultado.innerHTML = ""
}